import React from 'react';
import '../styles/TicketProtection.css';

const TicketProtection = () => {
  return (
    <div className="ticket-protection">
      <h1>บริการคุ้มครองบัตรการแสดง</h1>
      <p>Welcome to the Ticket Protection page!</p>
    </div>
  );
};

export default TicketProtection;
